import React, { useContext } from "react";
import { Container, Input, Item, Left, Right } from "./contextNav";
import { RiYoutubeFill } from "react-icons/ri";
import Context from "./Context";
import { MainContext } from "./ParentContext";
const ContextNavbar = () => {
  const [state,setState] =useContext(MainContext)
  return (
    <Container>
      <Left>
        <RiYoutubeFill />
        <>YouTube </>
      </Left>

      <Right>
        <Input  type="text" />

        <Item>Home</Item>
        <Item>Count </Item>
      </Right>
    </Container>
  );
};

export default ContextNavbar;
